Si Quey was a Chinese immigrant who moved to Thailand in 1944. He was accused of murdering seven boys, removing their internal organs and then eating them. The murders took place in Prachuap Khiri Khan, Bangkok, Nakhon Pathom and Rayong. In 1958 he was arrested in Rayong province, reportedly in possession of the body of a boy, together with the extracted heart and liver. He was executed by a firing squad the following year.
His body was then placed in the Museum of Medicine as a warning to potential killers.
